import React, { Component } from 'react';
import { connect } from 'react-redux';
import { FormattedMessage } from 'react-intl';
import "./HomeFooter.scss";

class HomeFooter extends Component {

    render() {

        <script async defer crossorigin="anonymous" src="https://connect.facebook.net/vi_VN/sdk.js#xfbml=1&version=v16.0" nonce="5mUFoj07"></script>

        return (
            <div className='home-footer-container'>
                <div className='home-footer-content-left'>
                    <div className='home-footer-title'>BaiAquatic
                        <hr></hr>
                    </div>
                    <div className='home-footer-content'>
                        <h5><b>CÔNG TY TNHH MTV ĐỨC TUẤN</b></h5>
                        <h5><b><i className='fas fa-envelope">'></i>Địa chỉ: Phước An, Lộc Tiến, Phú Lộc, T.T.Huế</b></h5>
                        <h5><b>Điện thoại: (012)3456789 - Hotline: 0123456789</b></h5>
                        <h5><b>Email: bai.aqua@gmail.com</b></h5>
                    </div>
                </div>
                <div className='home-footer-content-cennter'>
                    <div className='home-footer-title'>Bản đồ
                        <hr></hr>
                    </div>
                    <div className='home-footer-content'>
                        <iframe
                            src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3835.6678462548275!2d108.2478041747966!3d15.978712984687766!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3142108f6f859e1d%3A0xcd120ce0aefe3139!2zNzIgTMOqIFRoaeG7h24gVHLhu4ssIEhvw6AgSOG6o2ksIE5nxakgSMOgbmggU8ahbiwgxJDDoCBO4bq1bmcgNTUwMDAwLCBWaWV0bmFt!5e0!3m2!1sen!2s!4v1684756832540!5m2!1sen!2s"
                            title='Địa chỉ công ty'
                            width="100%"
                            height="350"
                            style={{ border: 0 }}
                            allowfullscreen=""
                            loading="lazy"
                            referrerpolicy="no-referrer-when-downgrade"
                        ></iframe>
                    </div>
                </div>
                <div className='home-footer-content-right'>
                    <div className='home-footer-title'>Fanpage
                        <hr></hr>
                    </div>
                    <div
                        class="fb-page home-footer-content"
                        data-href="https://www.facebook.com/adc.bai"
                        data-tabs="timeline"
                        data-width="100%"
                        data-height="350px"
                        data-small-header="false"
                        data-adapt-container-width="true"
                        data-hide-cover="false"
                        data-show-facepile="true">
                        #doccument
                    </div>
                </div>
            </div>
        );
    };

}

const mapStateToProps = state => {
    return {
        isLoggedIn: state.user.isLoggedIn,
        language: state.app.language
    };
};

const mapDispatchToProps = dispatch => {
    return {
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(HomeFooter);
